import SharedContext from './SharedContext';

/**
 * @return {object} JSX
 */
function Home() {
  const [mailbox, setMailbox] = React.useState('sent');
  const [mailid, setMailid] = React.useState('');
  return (
    <SharedContext.Provider
      value={{value: [mailbox, setMailbox], value2: [mailid, setMailid]}}>
      <TopBar />
      <MailList />
      <MailView />
    </SharedContext.Provider>
  );
}

export default Home;
